		"id": 1123618253149024300,
		"id_str": "1123618253149024263",
		"full_text": "@Jazzdog40 Thanks. I need to re-read de Waal, but isn't it the case that he stresses the commonality btn humans and other apes? That's pretty much what I meant by my tweet -- we should focus on the commonalities between us and them rather than projecting our distinctive features onto them.",
		"truncated": false,
